INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24015, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, 24, 10021, 110501, 4, "2019/07/31 12:00:00", 1, 0.0, 0.0, "カオリ（サマー）", 4, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24016, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 0.0, 24, 10021, 110501, 4, "2019/07/31 12:00:00", 2, 4.0, 0.0, "カオリ（サマー）", 1, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24017, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, 24, 10021, 110501, 4, "2019/07/31 12:00:00", 3, 0.0, 0.0, "カオリ（サマー）", 4, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24018, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 0.0, 24, 10021, 110501, 1, "2019/07/31 12:00:00", 4, 5.2, 0.0, "カオリ（サマー）", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24019, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 0.0, 24, 10021, 110501, 5, "2019/07/31 12:00:00", 5, 4.2, 0.0, "カオリ（サマー）", 6, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24020, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0, 24, 10021, 110501, 2, "2019/07/31 12:00:00", 6, 0.0, 0.0, "カオリ（サマー）", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 0.0, 24, 10021, 110501, 1, "2019/07/31 12:00:00", 7, 6.4, 0.0, "カオリ（サマー）", 6, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24022, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0, 24, 10021, 110501, 2, "2019/07/31 12:00:00", 8, 0.0, 0.0, "カオリ（サマー）", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24023, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 0.0, 24, 10021, 110501, 6, "2019/07/31 12:00:00", 9, 10.08, 0.0, "カオリ（サマー）", 3, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24024, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 0.0, 24, 10021, 110501, 1, "2019/07/31 12:00:00", 10, 5.0, 0.0, "カオリ（サマー）", 2, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24025, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0, 24, 10021, 110501, 2, "2019/07/31 12:00:00", 11, 0.0, 0.0, "カオリ（サマー）", 2, "2030/12/17 14:59:59");
